import React from 'react';
        import { TextField } from "@mui/material";




        function Project() {
        return (
<div>
    <center><h1>New project</h1></center>
    <p><b>About:    </b>
        <TextField rows="2"/></p>
    <p><b>Languages:    </b>
    <TextField/></p>
    <p><b>GitHub link:    </b>
        <TextField/></p>
</div>
        );
        }
        export default Project;
